import React from 'react';
import { Link, Outlet } from 'react-router-dom';
import Banner from '../Components/Banner/Banner';

const Contacts = () => {
    return (
        <div>

            <Banner
                pageTitle={'Blogs'}
                subtitle={'Here is Some of my blogs that i have made '}
            />
            <br />
            <Link to={'displayBlogs'}>
                <button>Display Connects </button>
            </Link>
            <Link to={'createBlogs'}>
                <button>Create Connects </button>
            </Link>

            <Outlet />
        </div>
    );
}

export default Contacts;
